 this page to restore:\u00a0https:\/\/www.elobuddy.net\/lostpassword\/\n \n\n\n\t\u00a0\n \n\n\n\n\tHello Buddies,<br>\n\t\u00a0\n \n\n\n\tThe past weeks have been very harsh. We are creating this topic to inform members what happened, and how it will affect the future.\n \n\n\n\t\u00a0\n \n\n\n\tEloBuddy has been hacked<br>\n\tEloBuddy has been hacked on 25.04.2016. The message being displayed was \"seized by Riot Games\", however we can ensure that this is obviously not the case and that Riot Games has nothing to do with this. Neither the leaked data will bring the security of your summoner in question.\u00a0The data that has been published contains:\n \n\n\n\n\t\tUsernames, Emails, Passwords (hashed and salted - but unhashable\u00a0if you use a simple password), Personal Messages\n\t \n\n\n\t\u00a0\n \n\n\n\tAll passwords have been reset on 08.05.2016.\n \n\n\n\t<br>AddOn Quality<br>\n\tEvery day we see a large amount of users complaining about the addon quality on EloBuddy. Let's start with the view of\u00a0a typical developer for EloBuddy:\n \n\n\n\t\u00a0\n \n\n\n\n\n\n\n\n\n\tPut yourself in the situation of a developer and ask yourself if you'd be willing to improve addons. If you want better addons, learn to give constructive feedback and if something works flawless, mention it.\n \n\n\n\t\u00a0\n \n\n\n\tPaid Scripts<br>\n\tWe have several requests from developers from competitors if they are allowed to sell Paid Scripts on EloBuddy. We have not allowed paid scripts on EloBuddy, but would like an opinion from our customers:\u00a0\n \n\n\n\n\t\tAre you willing to pay for a script that plays ARAM\/SR\u00a0and has an AI with machine learning?\n\t \n\t\n\t\tAre you willing to pay for a script that supports all ADCs, has its own Orbwalker and is updated frequently?\n\t \n\t\n\t\tAre you willing to pay for a script that evades spells for you?\n\t \n\t\n\t\t...\n\t \n\t\n\t\t... or are you happy with what is available?\n\t \n\n\n\tThink about the questions for a few days, meanwhile we will prepare a public survey regarding this.\n \n\n\n\t\u00a0\n \n\n\n\tDonations<br>\n\tWe will open donations on 01.06. The donations will go towards the project and will be shared amongst: Core and Lead developers, Developers and Contributors. EloBuddy will not be restricted. There will be no \"donator-only\" scripts. The only benefits a donator will receive is:\n \n\n\n\n\t\tColored name in the forum\n\t \n\t\n\t\tPossibility to remove watermark\n\t \n\n\n\t\u00a0\n \n\n\n\tStaff changes<br>\n\tYou may have noticed a few changes regarding our staff. To keep it short:\n \n\n\n\n\t\t@Helios - Webdeveloper who will improve the EloBuddy Forum and database<br>\n\t\t\u00a0\n\t \n\t\n\t\t@JokerArt (me) - Will take care of everything regarding the forum and improve the overall quality<br>\n\t\t\u00a0\n\t \n\t\n\t\t@Hellsing\u00a0- Decided to left the project for personal reasons (hopefully temporarily)<br>\n\t\t\u00a0\n\t \n\t\n\t\t@stefsot\u00a0- \u00a0Despite his recent announcement:he decided to come back. He will work on: SDK (Prediction), Loader, Champion Addons\n\t \n\n\n\tA full staff page featuring everyone tasks will folow.\n \n\n\n\t\u00a0\n \n\n\n\tAPI (advanced, Developers only)<br>\n\tThe API that empowers EloBuddy, made by @finndev\u00a0has been on hold for a few months already. It has only been updated to stay up to date for League of Legends patches. Developing addons will get bored, and we understand that. We will, but not limited to, add new API focusing on the following features which allows developers to invent new and unique addons:\n \n\n\n\n\t\tMesh editor - modify (create\/delete\/move)\u00a0mesh cells, build new custom maps with custom logic\n\t \n\t\n\t\tLoad, draw and dispose textures allocated\u00a0from the game \u00a0- this partially does exist, but is not close to finished\n\t \n\t\n\t\tOnCreate\/OnDelete Events revamped to avoid casts\n\t \n\n\n\t\u00a0\n \n\n\n\tEloBuddy is community driven and will always be, we will not make decisions without asking YOU.\n \n\n\n\t\u00a0\n \n\n\n\tYours,\n \n\n\n\tEloBuddy Staff\n \n\n\t\t\t\t\t\t\t<\/div>\n\t\t\t\t\t\t<\/div>\n\t\t\t\t\t<\/li>\n\t\t\t\t\n\t\t\t\t\t<li class='ipsDataItem'>\n\t\t\t\t\t\t<div class='ipsDataItem_icon ipsPos_top'>\n\t\t\t\t\t\t\t\n\r\n\r\n\t<a href=\"https:\/\/www.elobuddy.net\/profile\/7663-lurker7\/\" data-ipsHover data-ipsHover-target=\"https:\/\/www.elobuddy.net\/profile\/7663-lurker7\/?do=hovercard\" class=\"ipsUserPhoto ipsUserPhoto_tiny\" title=\"Go to Lurker7's profile\">\r\n\t\t<img src='https:\/\/www.elobuddy.net\/uploads\/set_resources_3\/84c1e40ea0e759e3f1505eb1788ddf3c_default_photo.png' alt='Lurker7' itemprop=\"image\">\r\n\t<\/a>\r\n\n\t\t\t\t\t\t<\/div>\n\t\t\t\t\t\t<div class='ipsDataItem_main'>\n\t\t\t\t\t\t\t<a href=\"https:\/\/www.elobuddy.net\/topic\/29481-eune-lf-support\/#comment-208834\" title='View the topic [EUNE] LF support' class='ipsType_medium ipsType_break'>[EUNE] LF support<\/a><br>\n\t\t\t\t\t\t\t<p class='ipsType_reset ipsType_light ipsType_medium ipsType_blendLinks'>By \n<a href='https:\/\/www.elobuddy.net\/profile\/7663-lurker7\/' data-ipsHover data-ipsHover-target='https:\/\/www.elobuddy.net\/profile\/7663-lurker7\/?do=hovercard&amp;referrer=https%253A%252F%252Fwww.elobuddy.net%252F' title=\"Go to Lurker7's profile\">Lurker7<\/a> &middot; <a href='https:\/\/www.elobuddy.net\/topic\/29481-eune-lf-support\/?do=findComment&amp;comment=208834' class='ipsType_blendLinks'>Posted <time datetime='2016-05-07T19:37:54Z' title='05\/07\/16  9:37  PM' data-short='1 dy'>yesterday at 9:37  PM<\/time><\/a><\/p>\n\t\t\t\t\t\t\t<div class='ipsType_medium ipsType_textBlock ipsType_richText ipsType_break ipsContained ipsSpacer_top ipsSpacer_half' data-ipsTruncate data-ipsTruncate-type='remove' data-ipsTruncate-size='6 lines'>\n\t\t\t\t\t\t\t\tHigh elo adc main lf support that was at least plat some time ago.\n \n\n\n\tPM me\n \n\n\n\tServer: EUNE\n \n\n\t\t\t\t\t\t\t<\/div>\n\t\t\t\t\t\t<\/div>\